Placing a Veil over her face and then having to close my wife’s casket may have been the saddest moment in my life, it was at that point I realized I would never see her again in the physical form. But her celebration of life party was the thing I needed to lift my spirits again. I had her favorite color, her favorite drink, her favorite people and even played her favorite songs and it was in that moment I realized she will always be with me in spirit and the smile on my daughter’s let me know that we will be ok.. I greatly appreciate everyone who came from all over the country to celebrate her life and all the people who made the party a success..

